import React from 'react';
import phone from './phone.jpg';

const telephone = () => {
  return (
    <div style={{display: 'flex', justifyContent: 'flex-start'}}>
      <img style={{width: '10px', height: '5px'}} alt='logo' src={phone} />
    </div>
  );
}

export default telephone;
